    false,nt"url": null,nt"notes": "repr. 1995, Landslide classification system,
    Open File Report 95-1. Because much of Washington's commercial forest land is in
    mountainous terrain,. that land is susceptible to slope instability of various forms
    and rates. Improper forest practices (notably those associated with road construction
    and maintenance and timber harvest) can increase mass wasting on slopes of marginal
    stability. Since implementation of the Timber/Fish/Wildlife Agreement in 1987, the
    Cooperative Monitoring, Evaluation, and Research committee, the Sediment, Hydrology,
    and Mass Wasting technical steering committee, and the Department of Natural Resources
    (DNR) have been engaged in cooperative interdisciplinary efforts to study mass erosion
    on forest lands, improve methods by which it is addressed, and generally reduce
    the adverse effects of forest practices on slope stability and downstream resources.",nt"license_title":
